class Solution(object):
    def summaryRanges(self, nums):
        """
        :type nums: List[int]
        :rtype: List[str]
        """

        if not nums:
            return []
        res = []
        start = nums[0]
        for i in range(len(nums)-1):
            if nums[i+1] != nums[i]+1:
                if start == nums[i]:
                    res.append(str(start))
                else:
                    res.append(str(start)+"->"+str(nums[i]))
                start = nums[i+1]
        if start == nums[-1]:
            res.append(str(start))
        else:
            res.append(str(start)+"->"+str(nums[-1]))
        return res

