class Solution(object):
    def firstMissingPositive(self, nums):
        """
        :type nums: List[int]
        :rtype: int
        """

        # 1. Sort the array
        nums.sort()

        # 2. Check if the first element is not 1
        if nums[0] != 1:
            return 1

        # 3. Check if the last element is not equal to the length of the array
        if nums[-1] != len(nums):
            return len(nums)

        # 4. Check if there is any missing positive integer
        for i in range(1, len(nums)):
            if nums[i] - nums[i-1] != 1:
                return nums[i-1] + 1

        # 5. If the array is sorted and there is no missing positive integer, return the length of the array + 1
        return len(nums) + 1

