class Solution(object):
    def addOperators(self, num, target):
        """
        :type num: str
        :type target: int
        :rtype: List[str]
        """

        def dfs(num, target, prev, res, path, idx):
            if idx == len(num):
                if prev == target:
                    res.append(path)
                return

            for i in range(idx, len(num)):
                if i != idx and num[idx] == '0':
                    break
                val = int(num[idx:i+1])
                if idx == 0:
                    dfs(num, target, val, res, str(val), i+1)
                else:
                    dfs(num, target, prev+val, res, path + '+' + str(val), i+1)
                    dfs(num, target, prev-val, res, path + '-' + str(val), i+1)
                    dfs(num, target, prev*val, res, path + '*' + str(val), i+1)

        res = []
        dfs(num, target, 0, res, "", 0)
        return res

