class Solution(object):
    def maxNumber(self, nums1, nums2, k):
        """
        :type nums1: List[int]
        :type nums2: List[int]
        :type k: int
        :rtype: List[int]
        """

        def compare(a, b):
            return [int(x) for x in str(int(a)) + str(int(b))]

        def max_merge(nums1, nums2, k):
            res = []
            for i in range(k):
                a = b = 0
                if len(nums1) > i: a = nums1[i]
                if len(nums2) > i: b = nums2[i]
                if a > b:
                    res.append(a)
                    nums2 = compare(b, a)
                else:
                    res.append(b)
                    nums1 = compare(a, b)
            return res

        def max_merge_k(nums1, nums2, k):
            if k == 0: return []
            if len(nums1) == 0: return nums2[:k]
            if len(nums2) == 0: return nums1[:k]
            if nums1[-1] > nums2[-1]:
                return max_merge_k(nums1, nums2[:-1], k-1) + [nums2[-1]]
            else:
                return max_merge_k(nums1[:-1], nums2, k-1) + [nums1[-1]]

        m, n = len(nums1), len(nums2)
        if k > m + n: return []
        if k == m + n: return max_merge(nums1, nums2, k)
        if k == 1: return [max(nums1[0], nums2[0])]
        start = 1
        end = min(m, n)
        while start + 1 < end:
            mid = (start + end) // 2
            if max_merge_k(nums1, nums2, mid)[-1] < max_merge_k(nums1, nums2, mid+1)[-1]:
                start = mid
            else:
                end = mid
        return max_merge_k(nums1, nums2, end)

