            for i in range(k):
                a = b = 0
                if len(nums1) > i:
                    a = nums1[i]
                if len(nums2) > i:
                    b = nums2[i]
                if a > b:
                    res.append(a)
                    nums2 = compare(b, a)
                else:
                    res.append(b)
                    nums1 = compare(a, b)
            return res

        def merge(nums1, nums2, k):
            if len(nums1) + len(nums2) < k:
                return []
            if len(nums1) > len(nums2):
                nums1, nums2 = nums2, nums1
            res = []
            for i in range(k):
                if not nums1:
                    return res + nums2[i:]
                if not nums2:
                    return res + nums1[i:]
                if nums1[0] > nums2[0]:
                    res.append(nums1[0])
                    nums1 = nums1[1:]
                else:
                    res.append(nums2[0])
                    nums2 = nums2[1:]
            return res

        def max_merge_k(nums1, nums2, k):
            if not nums1 or not nums2:
                return []
            if len(nums1) + len(nums2) == k:
                return max(nums1, nums2)
            if len(nums1) + len(nums2) < k:
                return []
            left = max_merge_k(nums1, nums2[1:], k)
            right = max_merge_k(nums1[1:], nums2, k)
            return max(left, right, key=lambda x: (x[0], -len(x)))

        def merge_k(nums1, nums2, k):
            if not nums1 or not nums2:
                return []
            if len(nums1) + len(nums2) == k:
                return merge(nums1, nums2, k)
            if len(nums1) + len(nums2) < k:
                return []
            left = merge_k(nums1, nums2[1:], k)
            right = merge_k(nums1[1:], nums2, k)
            return max(left, right, key=lambda x: (x[0], -len(x)))

        return merge_k(nums1, nums2, k)

