                new_s += s[vowels_index.pop()]
            else:
                new_s += s[i]
        return new_s

longest-consecutive-sequence.solution:
class Solution(object):
    def longestConsecutive(self, nums):
        """
        :type nums: List[int]
        :rtype: int
        """

        # Initialize a hash table to map each element to its index.
        table = {}
        for i, num in enumerate(nums):
            table[num] = i

        # Initialize the longest sequence so far.
        longest = 0

        # Iterate over each number.
        for i, num in enumerate(nums):

            # If the number is already part of a sequence, skip it.
            if i != table[num]:
                continue

            # Try to extend the sequence forward.
            while num + 1 in table:
                num += 1

            # Try to extend the sequence backward.
            while num - 1 in table:
                num -= 1

            # Update the longest sequence found so far.
            longest = max(longest, num - nums[i] + 1)

        return longest

