class Solution(object):
    def toHex(self, num):
        """
        :type num: int
        :rtype: str
        """

        if num == 0:
            return "0"
        if num < 0:
            num = 2**32 + num
        hex_string = ""
        hex_digits = "0123456789abcdef"
        while num > 0:
            hex_string = hex_digits[num % 16] + hex_string
            num //= 16
        return hex_string

