class Solution(object):
    def isValid(self, s):
        """
        :type s: str
        :rtype: bool
        """

        stack = []
        for i in s:
            if i == '(' or i == '[' or i == '{':
                stack.append(i)
            elif i == ')' or i == ']' or i == '}':
                if len(stack) == 0:
                    return False
                else:
                    top = stack.pop()
                    if i == ')' and top != '(':
                        return False
                    elif i == ']' and top != '[':
                        return False
                    elif i == '}' and top != '{':
                        return False
        if len(stack) != 0:
            return False
        return True

