couples-holding-hands.solution:
class Solution(object):
    def minSwapsCouples(self, row):
        """
        :type row: List[int]
        :rtype: int
        """

        # Initialize a dictionary to keep track of couples
        couple = {}
        for i in range(0, len(row), 2):
            couple[row[i]] = row[i+1]
            couple[row[i+1]] = row[i]

        # Initialize a list to keep track of all the swaps
        swaps = []

        # Iterate through the row
        for i in range(len(row)):

            # If the current person is not seated with his/her couple, then swap them
            if row[i] != couple[row[i]]:
                swaps.append(i)
                row[i], row[swaps[-1]] = row[swaps[-1]], row[i]

        return len(swaps)

