class Solution(object):
    def shortestPalindrome(self, s):
        """
        :type s: str
        :rtype: str
        """

        # Find the longest prefix which is also a suffix.
        l = len(s)
        for i in range(l//2):
            if s[:l-i] == s[i+1:]:
                break
        else:
            i = l

        # Build the palindrome
        return s[l-i:][::-1] + s

class Solution(object):
