class Solution(object):
    def minWindow(self, s, t):
        """
        :type s: str
        :type t: str
        :rtype: str
        """

        # Initialize the dictionary with all the characters of t.
        need = {}
        for i in t:
            if i not in need:
                need[i] = 1
            else:
                need[i] += 1

        # Initialize the dictionary for the window.
        have = {}

        # Left and right pointer
        left = 0
        right = 0

        # Length of the substring
        length = float('inf')

        # Form the window
        while right < len(s):

            # Add the character to have
            if s[right] not in have:
                have[s[right]] = 1
            else:
                have[s[right]] += 1

            # If the character is required
            if s[right] in need:

                # If the frequency is less than the required frequency
                if have[s[right]] <= need[s[right]]:

                    # Move the left pointer
                    while left < right and have[s[right]] > need[s[right]]:
                        have[s[left]] -= 1
                        left += 1

                    # If the substring is valid
                    if right - left + 1 < length:
                        length = right - left + 1
                        start = left

            right += 1

        # If no such substring is found
        if length == float('inf'):
            return ""

        # Return the substring
        return s[start: start + length]

