class Solution(object):
    def deleteDuplicates(self, head):
        """
        :type head: ListNode
        :rtype: ListNode
        """

        if head is None:
            return None

        if head.next is None:
            return head

        if head.val == head.next.val:
            head = head.next
            return self.deleteDuplicates(head)

        head.next = self.deleteDuplicates(head.next)
        return head

