class Solution(object):
    def cutOffTree(self, forest):
        """
        :type forest: List[List[int]]
        :rtype: int
        """

        # BFS
        # find the smallest tree
        # find the shortest path to the smallest tree
        # cut the smallest tree
        # repeat

        # find the smallest tree
        smallest_tree = 1000000000
        smallest_tree_position = []
        for i in range(len(forest)):
            for j in range(len(forest[0])):
                if forest[i][j] > 1 and forest[i][j] < smallest_tree:
                    smallest_tree = forest[i][j]
                    smallest_tree_position = [i, j]

        # find the shortest path to the smallest tree
        queue = []
        queue.append([0, 0])
        visited = set()
        visited.add((0, 0))
        step = 0
        while queue:
            for i in range(len(queue)):
                current_position = queue.pop(0)
                if current_position == smallest_tree_position:
                    return step
                for new_position in self.get_neighbors(current_position, forest):
                    if new_position not in visited and forest[new_position[0]][new_position[1]] != 0:
                        queue.append(new_position)
                        visited.add(new_position)
            step += 1

        return -1

    def get_neighbors(self, current_position, forest):
        neighbors = []
        if current_position[0] > 0 and forest[current_position[0] - 1][current_position[1]] != 0:
            neighbors.append([current_position[0] - 1, current_position[1]])
        if current_position[1] > 0 and forest[current_position[0]][current_position[1] - 1] != 0:
            neighbors.append([current_position[0], current_position[1] - 1])
        if current_position[0] < len(forest) - 1 and forest[current_position[0] + 1][current_position[1]] != 0:
            neighbors.append([current_position[0] + 1, current_position[1]])
        if current_position[1] < len(forest[0]) - 1 and forest[current_position[0]][current_position[1] + 1] != 0:
            neighbors.append([current_position[0], current_position[1] + 1])
        return neighbors

class Solution(object):
    def cutOffTree(self, forest):
        """
        :type forest: List[List[int]]
        :rtype: int
        """

        def bfs(forest, start):
            queue = collections.deque([start])
            visited = set([start])
            height = 0
            while queue:
                for _ in range(len(queue)):
                    x, y = queue.popleft()
                    if forest[x][y] > height:
                        height = forest[x][y]
                    for dx, dy in [(1, 0), (-1, 0), (0, 1), (0, -1)]:
                        nx, ny = x + dx, y + dy
                        if 0 <= nx < len(forest) and 0 <= ny < len(forest[0]) and (nx, ny) not in visited and forest[nx][ny] > 0:
                            queue.append((nx, ny))
                            visited.add((nx, ny))
                if height > 0:
                    return height
            return -1

        heights = [i for i in forest if i != [0] for j in i if j > 0]
        heights.sort()
        start = None
        for i in range(len(forest)):
            for j in range(len(forest[0])):
                if forest[i][j] > 0:
                    start = (i, j)
                    break
        ans = 0
        for height in heights:
            ans += bfs(forest, start)
            if ans == -1:
                return -1
            forest[start[0]][start[1]] = 1
            start = None
        return ans

