class Solution(object):
    def countRangeSum(self, nums, lower, upper):
        """
        :type nums: List[int]
        :type lower: int
        :type upper: int
        :rtype: int
        """

        # Merge Sort
        def mergeSort(nums):
            if len(nums) > 1:
                mid = len(nums) // 2
                L = nums[:mid]
                R = nums[mid:]
                mergeSort(L)
                mergeSort(R)
                i = j = k = 0
                while i < len(L) and j < len(R):
                    if L[i] < R[j]:
                        nums[k] = L[i]
                        i += 1
                    else:
                        nums[k] = R[j]
                        j += 1
                    k += 1

                while i < len(L):
                    nums[k] = L[i]
                    i += 1
                    k += 1

                while j < len(R):
                    nums[k] = R[j]
                    j += 1
                    k += 1

        # Merge Sort
        def mergeSort(nums):
            if len(nums) > 1:
                mid = len(nums) // 2
                L = nums[:mid]
                R = nums[mid:]
                mergeSort(L)
                mergeSort(R)
                i = j = k = 0
                while i < len(L) and j < len(R):
                    if L[i] < R[j]:
                        nums[k] = L[i]
                        i += 1
                    else:
                        nums[k] = R[j]
                        j += 1
                    k += 1

                while i < len(L):
                    nums[k] = L[i]
                    i += 1
                    k += 1

                while j < len(R):
                    nums[k] = R[j]
                    j += 1
                    k += 1

        # Binary Search
        def binarySearch(nums, target):
            low = 0
            high = len(nums) - 1
            while low <= high:
                mid = (low + high) // 2
                if nums[mid] == target:
                    return mid
                elif nums[mid] < target:
                    low = mid + 1
                else:
                    high = mid - 1
            return low

        # Count Range Sum
        def countRangeSum(nums, lower, upper):
            n = len(nums)
            if n == 0:
                return 0
            presum = [0] * (n + 1)
            for i in range(n):
                presum[i + 1] = presum[i] + nums[i]
            mergeSort(presum)
            count = 0
            for i in range(n + 1):
                if i == 0:
                    count += binarySearch(presum, upper + 1)
                else:
                    count += binarySearch(presum, upper + 1) - binarySearch(presum, lower + presum[i])
            return count

        return countRangeSum(nums, lower, upper)

