class Solution(object):
    def arrangeCoins(self, n):
        """
        :type n: int
        :rtype: int
        """

        # Complete this function
        # For loop to iterate from 1 to n
        for i in range(1, n+1):
            # Check if the current row is complete
            if n == i:
                return i
            # Check if the current row is incomplete
            elif n < i:
                return i-1

