#     def __init__(self, val=0, left=None, right=None):
#         self.val = val
#         self.left = left
#         self.right = right
class Solution(object):
    def isValidBST(self, root):
        """
        :type root: TreeNode
        :rtype: bool
        """

        def isValidBSTHelper(root, minValue, maxValue):
            if root is None:
                return True
            if root.val <= minValue or root.val >= maxValue:
                return False
            return isValidBSTHelper(root.left, minValue, root.val) and isValidBSTHelper(root.right, root.val, maxValue)
