class Solution(object):
    def partition(self, s):
        """
        :type s: str
        :rtype: List[List[str]]
        """

        def isPalindrome(s):
            return s == s[::-1]

        def helper(s, path, res):
            if not s:
                res.append(path)
                return
            for i in range(1, len(s)+1):
                if isPalindrome(s[:i]):
                    helper(s[i:], path+[s[:i]], res)

        res = []
        helper(s, [], res)
        return res

