class Solution(object):
    def uniquePaths(self, m, n):
        """
        :type m: int
        :type n: int
        :rtype: int
        """

        # Initialize the dp table with 1's.
        dp = [[1]*n for _ in range(m)]

        # Fill in the values for the first row.
        for i in range(1, m):
            for j in range(n):
                dp[i][j] = dp[i-1][j]

        # Fill in the values for the first column.
        for i in range(m):
            for j in range(1, n):
                dp[i][j] = dp[i][j-1]

        return dp[m-1][n-1]

