        """

        # Initialize the dp array
        dp = [i for i in range(len(s)+1)]

        # Initialize the palindrome array
        palindrome = [[False for i in range(len(s))] for j in range(len(s))]

        # Fill the palindrome array
        for i in range(len(s)):
            palindrome[i][i] = True
            if i+1 < len(s) and s[i] == s[i+1]:
                palindrome[i][i+1] = True

        # Fill the palindrome array
        for i in range(len(s)-2,-1,-1):
            for j in range(i+2,len(s)):
                if s[i] == s[j] and palindrome[i+1][j-1]:
                    palindrome[i][j] = True

        # Fill the dp array
        for i in range(1,len(s)):
            if palindrome[0][i]:
                dp[i] = 0
            else:
                dp[i] = min(dp[j]+1 for j in range(i) if palindrome[j+1][i])

