class Solution(object):
    def preimageSizeFZF(self, k):
        """
        :type k: int
        :rtype: int
        """

        def count_zeroes(n):
            count = 0
            while n > 0:
                n, remainder = divmod(n, 5)
                count += remainder
            return count

        low = 0
        high = 5 * k
        while low <= high:
            mid = (low + high) // 2
            zeroes = count_zeroes(mid)
            if zeroes < k:
                low = mid + 1
            elif zeroes > k:
                high = mid - 1
            else:
                return 5
        return 0

