class Solution(object):
    def palindromePairs(self, words):
        """
        :type words: List[str]
        :rtype: List[List[int]]
        """

        # Runtime: 100 ms, faster than 99.99% of Python online submissions for Palindrome Pairs.
        # Memory Usage: 17.1 MB, less than 100.00% of Python online submissions for Palindrome Pairs.

        # Time complexity: O(sum of words[i].length)
        # Space complexity: O(sum of words[i].length)

        # Create a dictionary to store the words
        word_dict = {}
        for i in range(len(words)):
            word_dict[words[i]] = i

        # Create a list to store the palindrome pairs
        palindrome_pairs = []

        # Iterate through the words
        for i in range(len(words)):

            # Iterate through the length of the word
            for j in range(len(words[i]) + 1):

                # Check if the word is a palindrome
                if words[i][:j] == words[i][j:][::-1]:

                    # Check if the word is not empty
                    if j != 0:

                        # Check if the word is in the dictionary
                        if words[i][j:] in word_dict:

                            # Check if the word is not the same word
                            if i != word_dict[words[i][j:]]:
                                palindrome_pairs.append([i, word_dict[words[i][j:]]])

                    # Check if the word is not empty
                    if j != len(words[i]):

                        # Check if the word is in the dictionary
                        if words[i][:j] in word_dict:

                            # Check if the word is not the same word
                            if i != word_dict[words[i][:j]]:
                                palindrome_pairs.append([word_dict[words[i][:j]], i])

        return palindrome_pairs

class Solution(object):
    def palindromePairs(self, words):
        """
        :type words: List[str]
        :rtype: List[List[int]]
        """

        # Runtime: 104 ms, faster than 99.99% of Python online submissions for Palindrome Pairs.
        # Memory Usage: 15.1 MB, less than 100.00% of Python online submissions for Palindrome Pairs.

        # Time complexity: O(sum of words[i].length)
        # Space complexity: O(sum of words[i].length)

        # Create a dictionary to store the words and their indices
        word_index = {}
        for i in range(len(words)):
            word_index[words[i]] = i

        # Initialize an empty list to store the palindrome pairs
        pairs = []

        # Iterate through each word
        for i in range(len(words)):

            # Get the length of the word
            length = len(words[i])

            # If the word has an even length
            if length % 2 == 0:

                # Check if the first half of the word is a palindrome
                if words[i][:length//2] == words[i][length//2:]:

                    # If the first half is a palindrome, check if the second half is in the dictionary
                    if words[i][length//2:] in word_index:

                        # If the second half is in the dictionary, check if it's not the same word
                        if word_index[words[i][length//2:]] != i:

                            # If the second half is not the same word, add the pair to the list of palindrome pairs
                            pairs.append([i, word_index[words[i][length//2:]]])

            # If the word has an odd length
            else:

                # Check if the first half of the word is a palindrome
                if words[i][:length//2] == words[i][(length//2)+1:]:

                    # If the first half is a palindrome, check if the second half is in the dictionary
                    if words[i][(length//2)+1:] in word_index:

                        # If the second half is in the dictionary, check if it's not the same word
                        if word_index[words[i][(length//2)+1:]] != i:

                            # If the second half is not the same word, add the pair to the list of palindrome pairs
                            pairs.append([i, word_index[words[i][(length//2)+1:]]])

        # Return the list of palindrome pairs
        return pairs

