class Solution(object):
    def wordBreak(self, s, wordDict):
        """
        :type s: str
        :type wordDict: List[str]
        :rtype: List[str]
        """

        # Initialize the dictionary
        d = {}
        d[0] = []

        # Initialize the result
        result = []

        # Loop through the string
        for i in range(1, len(s) + 1):

            # Check if the substring is in the dictionary
            if s[:i] in wordDict:

                # If it is, add it to the dictionary
                d[i] = [s[:i]]

                # If there is a word that can be added to it
                if i in d:

                    # Add the word to the result
                    for word in d[i]:
                        result.append(word + " ")

            # If the substring is not in the dictionary
            else:

                # Check if there is a word that can be added to it
                if i in d:

                    # Add the word to the result
                    for word in d[i]:
                        result[len(word)] = word + " "

        # Return the result
        return result

