    def wordBreak(self, s, wordDict):
        """
        :type s: str
        :type wordDict: List[str]
        :rtype: List[str]
        """

        # Initialize the dictionary
        d = {}
        d[0] = []

        # Loop through the string
        for i in range(1, len(s) + 1):
            d[i] = []
            for j in range(i):
                if s[j:i] in wordDict and d[j] != []:
                    for k in d[j]:
                        d[i].append(k + ' ' + s[j:i])
                elif s[j:i] in wordDict and d[j] == []:
                    d[i].append(s[j:i])

        return d[len(s)]

