    def wordBreak(self, s, wordDict):
        """
        :type s: str
        :type wordDict: List[str]
        :rtype: List[str]
        """

        # Initialize the dp array with False
        dp = [False] * (len(s) + 1)
        dp[0] = True

        # Fill in the dp array
        for i in range(1, len(s) + 1):
            for j in range(i):
                if dp[j] and s[j:i] in wordDict:
                    dp[i] = True
                    break

        # If the last index is True, then there is a valid word break
        if not dp[-1]:
            return []

        # Initialize the result list
        res = []

        # Backtracking
        self.dfs(s, 0, [], dp, wordDict, res)

        return res

    def dfs(self, s, start, path, dp, wordDict, res):
        if start == len(s):
            res.append(" ".join(path))
