    def readBinaryWatch(self, turnedOn):
        """
        :type turnedOn: int
        :rtype: List[str]
        """

        def get_time(hour, minute):
            return str(hour) + ':' + ('0' + str(minute) if minute < 10 else str(minute))

        def get_hours(num):
            hours = []
            for i in range(12):
                if bin(i).count('1') == num:
                    hours.append(i)
            return hours

        def get_minutes(num):
            minutes = []
            for i in range(60):
                if bin(i).count('1') == num:
                    minutes.append(i)
            return minutes

