            if num_on == 0:
                return [0]
            elif num_on == 1:
                return [1, 2, 4, 8, 16, 32]
            elif num_on == 2:
                return [3, 5, 9, 6, 10, 12, 20, 24, 30, 40]
            elif num_on == 3:
                return [7, 11, 13, 14, 15, 21, 25, 28, 31, 33, 34, 39, 41, 42, 43, 45, 46, 47, 49, 50, 52, 56]
            else:
                return []

