class Solution(object):
    def trapRainWater(self, heightMap):
        """
        :type heightMap: List[List[int]]
        :rtype: int
        """

        # Find the bounding rectangle
        R = len(heightMap)
        C = len(heightMap[0])
        visited = [[False] * C for _ in range(R)]
        q = []
        for r in range(R):
            for c in range(C):
                if r in [0, R-1] or c in [0, C-1]:
                    q.append((r, c))
                    visited[r][c] = True

        # BFS
        ans = 0
        while q:
            cell = q.pop(0)
            for nr, nc in [(cell[0]-1, cell[1]), (cell[0]+1, cell[1]), (cell[0], cell[1]-1), (cell[0], cell[1]+1)]:
                if 0 <= nr < R and 0 <= nc < C and not visited[nr][nc]:
                    visited[nr][nc] = True
                    height = heightMap[nr][nc]
                    if height < heightMap[cell[0]][cell[1]]:
                        ans += heightMap[cell[0]][cell[1]] - height
                    q.append((nr, nc))
        return ans

