class Solution(object):
    def maxSumSubmatrix(self, matrix, k):
        """
        :type matrix: List[List[int]]
        :type k: int
        :rtype: int
        """

        # Initialize the maximum sum to be 0
        max_sum = 0

        # Loop through each row of the matrix
        for i in range(len(matrix)):

            # Initialize a list to store the prefix sum
            prefix_sum = [0] * len(matrix[i])

            # Loop through each column of the matrix
            for j in range(i, len(matrix)):

                # Calculate the prefix sum
                for l in range(len(matrix[j])):
                    prefix_sum[l] += matrix[j][l]

                # Initialize two pointers for binary search
                left, right = 0, len(prefix_sum) - 1

                # Loop through each prefix sum
                for m in range(len(prefix_sum)):

                    # Check if the prefix sum is less than k
                    if prefix_sum[m] <= k:

                        # Binary search to find the largest rectangle
                        while left < right:
                            if prefix_sum[right] - prefix_sum[m] > k:
                                right -= 1
                            else:
                                break

                        # Update the maximum sum
                        max_sum = max(max_sum, prefix_sum[right] - prefix_sum[m])

                    # If the prefix sum is greater than k
                    else:

                        # Binary search to find the smallest rectangle
                        while left < right:
                            if prefix_sum[left + 1] - prefix_sum[m] <= k:
                                left += 1
                            else:
                                break

                        # Update the maximum sum
                        max_sum = max(max_sum, prefix_sum[left] - prefix_sum[m])

        return max_sum

