class Solution(object):
    def divide(self, dividend, divisor):
        """
        :type dividend: int
        :type divisor: int
        :rtype: int
        """

        if dividend == 0:
            return 0

        if divisor == 1:
            return dividend

        if divisor == -1:
            return -dividend

        if dividend == divisor:
            return 1

        if dividend == -divisor:
            return -1

        if abs(dividend) < abs(divisor):
            return 0

        sign = 1
        if (dividend < 0 and divisor > 0) or (dividend > 0 and divisor < 0):
            sign = -1

        dividend = abs(dividend)
        divisor = abs(divisor)

        quotient = 0
        while dividend >= divisor:
            dividend -= divisor
            quotient += 1

        return quotient * sign

