            if len(cards) == 1:
                return abs(cards[0] - 24.0) < 1e-6

            for i in range(len(cards)):
                for j in range(i+1, len(cards)):
                    a, b = cards[i], cards[j]
                    rest = cards[:i] + cards[i+1:j] + cards[j+1:]
                    for op in ['+', '-', '*', '/']:
                        if op == '/':
                            if b == 0:
                                continue
                            if solve(rest + [a / b]):
                                return True
                        else:
                            if solve(rest + [a + b, a - b, a * b]):
                                return True
            return False

        return solve(cards)

