class Solution(object):
    def majorityElement(self, nums):
        """
        :type nums: List[int]
        :rtype: int
        """

        # Initialize a dictionary to store count of each element
        count = {}

        # Loop through the array
        for i in nums:

            # If the element is not in the dictionary add it
            if i not in count:
                count[i] = 1

            # If the element is in the dictionary increment its count
            else:
                count[i] += 1

        # Return the element with the highest count
        return max(count, key=count.get)

