class Solution(object):
    def splitArray(self, nums, k):
        """
        :type nums: List[int]
        :type k: int
        :rtype: int
        """

        def check(nums, k, mid):
            cnt = 0
            s = 0
            for i in range(len(nums)):
                s += nums[i]
                if s > mid:
                    cnt += 1
                    s = nums[i]
            cnt += 1
            return cnt <= k

        def check_mid(nums, k, mid):
            cnt = 0
            s = 0
            for i in range(len(nums)):
                s += nums[i]
                if s > mid:
                    cnt += 1
                    s = nums[i]
            cnt += 1
            return cnt

        l = max(nums)
        r = sum(nums)
        while l < r:
            mid = (l + r) // 2
            if check(nums, k, mid):
                r = mid
            else:
                l = mid + 1
        return l

