letter-combinations-of-a-phone-number.solution:
class Solution(object):
    def letterCombinations(self, digits):
        """
        :type digits: str
        :rtype: List[str]
        """

        if len(digits) == 0:
            return []

        mapping = {
            '2': 'abc',
            '3': 'def',
            '4': 'ghi',
            '5': 'jkl',
            '6': 'mno',
            '7': 'pqrs',
            '8': 'tuv',
            '9': 'wxyz'
        }

        result = []

        for i in range(len(digits)):
            if i == 0:
                for j in mapping[digits[i]]:
                    result.append(j)
            else:
                temp = []
                for j in mapping[digits[i]]:
                    for k in result:
                        temp.append(k+j)
                result = temp

        return result

find-the-closest-palindrome.solution:
class Solution(object):
    def nearestPalindromic(self, n):
        """
        :type n: str
        :rtype: str
        """

        def isPalindrome(s):
            return s == s[::-1]

        def getPalindrome(s):
            return s + s[::-1]

        def getClosest(s):
            l = len(s)
            if l % 2 == 0:
                return min(s[:l//2-1] + getPalindrome(s[l//2-1:]), s[:l//2] + getPalindrome(s[l//2:]))
            else:
                return min(s[:l//2] + getPalindrome(s[l//2+1:]), s[:l//2-1] + getPalindrome(s[l//2:]))

        if len(n) == 1:
            return str(int(n)-1)

        l = len(n)
        if isPalindrome(n):
            return getClosest(n[:l//2-1] + n[l//2+1:])

        left = n[:l//2]
        right = n[l//2:]
        if left == right:
            return getPalindrome(left)

        closest = getClosest(left)
        if abs(int(closest) - int(n)) > abs(int(n[:l//2-1] + n[l//2+1:]) - int(n)):
            return n[:l//2-1] + n[l//2+1:]
        return closest

