class Solution(object):
    def findRelativeRanks(self, score):
        """
        :type score: List[int]
        :rtype: List[str]
        """

        # Sort the list in descending order
        score.sort(reverse=True)

        # Create a dictionary to map the scores to their ranks
        rank_map = {score[i]:str(i+1) for i in range(len(score))}

        # Create a list to map the ranks to their corresponding medal
        rank_medal_map = {1:"Gold Medal", 2:"Silver Medal", 3:"Bronze Medal"}

        # Create a list to store the final answer
        answer = []

        # Iterate through each score and map it to its corresponding rank and medal
        for s in score:
            if s in rank_medal_map:
                answer.append(rank_medal_map[s])
            else:
                answer.append(rank_map[s])

        return answer

