class Solution(object):
    def findSubstring(self, s, words):
        """
        :type s: str
        :type words: List[str]
        :rtype: List[int]
        """

        if not words:
            return []

        word_len = len(words[0])
        total_len = word_len * len(words)
        word_dict = {}
        for word in words:
            if word not in word_dict:
                word_dict[word] = 1
            else:
                word_dict[word] += 1

        result = []
        for i in range(len(s) - total_len + 1):
            if self.check_substring(s[i:i+total_len], word_len, word_dict):
                result.append(i)

        return result

    def check_substring(self, s, word_len, word_dict):
        word_count = {}
        for i in range(0, len(s), word_len):
            word = s[i:i+word_len]
            if word not in word_dict:
                return False
            if word not in word_count:
                word_count[word] = 1
            else:
                word_count[word] += 1
            if word_count[word] > word_dict[word]:
                return False
        return True

