class Solution(object):
    def minStickers(self, stickers, target):
        """
        :type stickers: List[str]
        :type target: str
        :rtype: int
        """

        # 1. Create a dictionary to store the frequency of each letter in the target string
        target_freq = {}
        for letter in target:
            if letter not in target_freq:
                target_freq[letter] = 1
            else:
                target_freq[letter] += 1

        # 2. Create a dictionary to store the frequency of each letter in each sticker
        sticker_freq = {}
        for sticker in stickers:
            for letter in sticker:
                if letter not in sticker_freq:
                    sticker_freq[letter] = 1
                else:
                    sticker_freq[letter] += 1

        # 3. Create a dictionary to store the frequency of each letter in the stickers combined
        combined_freq = {}
        for sticker in stickers:
            for letter in sticker:
                if letter not in combined_freq:
                    combined_freq[letter] = sticker_freq[letter]
                else:
                    combined_freq[letter] += sticker_freq[letter]

        # 4. Create a queue to store the letters in the target string
        queue = []
        for letter in target:
            queue.append(letter)

        # 5. Create a set to store the letters that have been used
        used = set()

        # 6. Create a variable to store the number of stickers used
        stickers_used = 0

        # 7. While the queue is not empty
        while queue:

            # 8. Get the first letter in the queue
            letter = queue.pop(0)

            # 9. If the letter has not been used
            if letter not in used:

                # 10. If the letter is not in the combined frequency dictionary
                if letter not in combined_freq:

                    # 11. Return -1
                    return -1

                # 12. If the letter is in the combined frequency dictionary
                else:

                    # 13. Get the frequency of the letter in the combined frequency dictionary
                    freq = combined_freq[letter]

                    # 14. If the frequency is less than the frequency of the letter in the target string
                    if freq < target_freq[letter]:

                        # 15. Return -1
                        return -1

                    # 16. If the frequency is greater than or equal to the frequency of the letter in the target string
                    else:

                        # 17. Add the letter to the used set
                        used.add(letter)

                        # 18. Increment the number of stickers used
                        stickers_used += 1

                        # 19. If the number of letters in the used set is equal to the length of the target string
                        if len(used) == len(target):

                            # 20. Return the number of stickers used
                            return stickers_used

                        # 21. If the number of letters in the used set is less than the length of the target string
                        else:

                            # 22. Add the letters in the target string that are not in the used set to the queue
                            for letter in target:
                                if letter not in used:
                                    queue.append(letter)

class Solution(object):
    def minStickers(self, stickers, target):
        """
        :type stickers: List[str]
        :type target: str
        :rtype: int
        """

        # 1. Initialize the dp array
        dp = [0] * 26
        for i in range(len(target)):
            dp[ord(target[i]) - ord('a')] += 1

        # 2. Initialize the dp array
        dp = [0] * 26
        for i in range(len(target)):
            dp[ord(target[i]) - ord('a')] += 1

        # 3. Loop through the dp array
        for i in range(26):
            if dp[i] > 0:
                for j in range(len(stickers)):
                    if ord(stickers[j][i]) - ord('a') == i:
                        dp[i] = min(dp[i], 1 + self.minStickers(stickers[:j] + stickers[j+1:], target))
                        break
        return min(dp) if sum(dp) == len(target) else -1

class Solution(object):
    def minStickers(self, stickers, target):
        """
        :type stickers: List[str]
        :type target: str
        :rtype: int
        """

        def check(target, d):
            for c in target:
                if c not in d or d[c] <= 0:
                    return False
            return True

        def dfs(target, d, step):
            if check(target, d):
                return step
            for i in range(len(stickers)):
                for c in stickers[i]:
                    if c in d:
                        d[c] += 1
                if dfs(target, d, step + 1) != -1:
                    return step + 1
                for c in stickers[i]:
                    if c in d:
                        d[c] -= 1
            return -1

        d = {}
        for c in target:
            if c not in d:
                d[c] = 0
        return dfs(target, d, 0)

