    def minStickers(self, stickers, target):
        """
        :type stickers: List[str]
        :type target: str
        :rtype: int
        """

        # dp[i] represents the minimum number of stickers needed to form the first i characters of target
        dp = [0] * (len(target) + 1)
        for i in range(1, len(target) + 1):
            dp[i] = float('inf')
            for j in range(len(stickers)):
                if target[i - 1] in stickers[j]:
                    dp[i] = min(dp[i], dp[i - 1] + 1)
                    break
            for k in range(i):
                if target[k] in stickers[j]:
                    dp[i] = min(dp[i], dp[k] + 1)
                    break

        return -1 if dp[-1] == float('inf') else dp[-1]

