class Solution(object):
    def maxSlidingWindow(self, nums, k):
        """
        :type nums: List[int]
        :type k: int
        :rtype: List[int]
        """

        if not nums:
            return []

        n = len(nums)
        left = [0] * n
        right = [0] * n
        left[0] = nums[0]
        right[n-1] = nums[n-1]

        for i in range(1, n):
            if i % k == 0:
                left[i] = nums[i]
            else:
                left[i] = max(left[i-1], nums[i])

            j = n - i - 1
            if (j+1) % k == 0:
                right[j] = nums[j]
            else:
                right[j] = max(right[j+1], nums[j])

        ans = []
        for i in range(n-k+1):
            ans.append(max(right[i], left[i+k-1]))

        return ans

