    def getRow(self, rowIndex):
        """
        :type rowIndex: int
        :rtype: List[int]
        """

        if rowIndex == 0:
            return [1]
        else:
            row = [1]
            for i in range(1, rowIndex+1):
                row.append(row[i-1]*(rowIndex+1-i)/i)
