class Solution(object):
    def findLadders(self, beginWord, endWord, wordList):
        """
        :type beginWord: str
        :type endWord: str
        :type wordList: List[str]
        :rtype: List[List[str]]
        """

        # BFS
        # Time O(N)
        # Space O(N)

        wordList = set(wordList)
        if endWord not in wordList:
            return []

        queue = collections.deque([(beginWord, 0)])
        visited = set()
        while queue:
            word, step = queue.popleft()
            if word not in visited:
                visited.add(word)
                for i in range(len(word)):
                    for j in range(26):
                        new_word = word[:i] + chr(97+j) + word[i+1:]
                        if new_word in wordList:
                            if new_word == endWord:
                                return [self.get_path(beginWord, endWord, visited)]
                            queue.append((new_word, step+1))
        return []

    def get_path(self, beginWord, endWord, visited):
        path = []
        word = endWord
        while word != beginWord:
            path.append(word)
            for w in visited:
                if w != word and self.diff_by_one(w, word):
                    word = w
                    break
        path.append(beginWord)
        return path[::-1]

    def diff_by_one(self, word1, word2):
        diff = 0
        for i in range(len(word1)):
            if word1[i] != word2[i]:
                diff += 1
        return diff == 1

