    def isIsomorphic(self, s, t):
        """
        :type s: str
        :type t: str
        :rtype: bool
        """

        # Mapping of characters in s to characters in t
        s_to_t = {}
        t_to_s = {}

        # Iterate through the strings
        for i in range(len(s)):

            # If the characters are not in the mapping, add them
            if s[i] not in s_to_t:
                s_to_t[s[i]] = t[i]
            if t[i] not in t_to_s:
                t_to_s[t[i]] = s[i]

            # If the characters are already in the mapping and don't match, return false
            if s_to_t[s[i]] != t[i] or t_to_s[t[i]] != s[i]:
                return False

        return True

