        if len(nums) == 0:
            return False

        if len(nums) == 1:
            return nums[0] == target

        left = 0
        right = len(nums) - 1

        while left <= right:
            mid = (left + right) // 2

            if nums[mid] == target:
                return True

            if nums[mid] == nums[left]:
                left += 1
