class Solution(object):
    def numDecodings(self, s):
        """
        :type s: str
        :rtype: int
        """

        MOD = 10**9 + 7
        n = len(s)
        dp = [0] * (n + 1)
        dp[0] = 1

        for i in range(1, n + 1):
            if s[i - 1] != '*':
                dp[i] += dp[i - 1]
            else:
                dp[i] += 9 * dp[i - 1]

            if i > 1 and s[i - 2] != '*' and int(s[i - 2] + s[i - 1]) <= 26:
                dp[i] += dp[i - 2]
            elif i > 1 and s[i - 2] == '*' and s[i - 1] != '0':
                dp[i] += 2 * dp[i - 2]
            elif i > 1 and s[i - 2] == '*' and s[i - 1] == '0':
                dp[i] += dp[i - 2]

            dp[i] %= MOD

        return dp[n]

