class Solution(object):
    def strongPasswordChecker(self, password):
        """
        :type password: str
        :rtype: int
        """

        # 1. Check if password is strong
        # 2. If not, check if it is weak
        # 3. If not, check if it is medium
        # 4. If not, check if it is strong

        # 1. Check if password is strong
        if len(password) >= 6 and len(password) <= 20:
            if self.check_lowercase(password) and self.check_uppercase(password) and self.check_digit(password):
                return 0

        # 2. If not, check if it is weak
        if len(password) < 6:
            return 6 - len(password)

        # 3. If not, check if it is medium
        if len(password) > 20:
            return self.check_medium(password)

        # 4. If not, check if it is strong
        return self.check_strong(password)

    def check_lowercase(self, password):
        for i in range(len(password)):
            if password[i].islower():
                return True
        return False

    def check_uppercase(self, password):
        for i in range(len(password)):
            if password[i].isupper():
                return True
        return False

    def check_digit(self, password):
        for i in range(len(password)):
            if password[i].isdigit():
                return True
        return False

    def check_medium(self, password):
        count = 0
        for i in range(len(password)):
            if password[i].islower():
                count += 1
            elif password[i].isupper():
                count += 1
            elif password[i].isdigit():
                count += 1
            else:
                count += 2
        return count

    def check_strong(self, password):
        count = 0
        for i in range(len(password)):
            if password[i].islower():
                count += 1
            elif password[i].isupper():
                count += 1
            elif password[i].isdigit():
                count += 1
            else:
                count += 2
        return count

