    def strongPasswordChecker(self, password):
        """
        :type password: str
        :rtype: int
        """

        # 1. Check for length
        # 2. Check for lowercase
        # 3. Check for uppercase
        # 4. Check for digit
        # 5. Check for repeating characters

        # 1. Check for length
        if len(password) < 6:
            return 6 - len(password)
        elif len(password) > 20:
            return 20 - len(password)

        # 2. Check for lowercase
        if not any(c.islower() for c in password):
            return max(1, len(password) - 20) + 1

        # 3. Check for uppercase
        if not any(c.isupper() for c in password):
            return max(1, len(password) - 20) + 1

        # 4. Check for digit
        if not any(c.isdigit() for c in password):
            return max(1, len(password) - 20) + 1

        # 5. Check for repeating characters
        i = 2
        count = 1
        while i < len(password):
            if password[i] == password[i-1]:
                count += 1
                if count == 3:
                    return len(password) - 2
            else:
                count = 1
            i += 1

        return max(0, 3 - len(password))

