        """
        :type password: str
        :rtype: int
        """

        # Initialize variables
        length = len(password)
        has_lower = False
        has_upper = False
        has_digit = False
        has_three = False
        replace = 0
        delete = 0
        add = 0

        # Check for length
        if length < 6:
            add = 6 - length
        elif length > 20:
            delete = length - 20
        else:
            add = 0
            delete = 0

        # Check for characters
        for i in range(length):
            if password[i].islower():
                has_lower = True
            elif password[i].isupper():
                has_upper = True
            elif password[i].isdigit():
                has_digit = True
            if i < length - 2:
                if password[i] == password[i+1] == password[i+2]:
                    has_three = True

        # Check for three repeating characters
        if has_three:
            replace = 1

        # Return minimum number of steps
        return max(add, delete, replace)

