class Solution(object):
    def fractionToDecimal(self, numerator, denominator):
        """
        :type numerator: int
        :type denominator: int
        :rtype: str
        """

        if numerator == 0:
            return "0"

        if denominator == 0:
            return "NaN"

        if numerator < 0 and denominator > 0:
            sign = "-"
        elif numerator > 0 and denominator < 0:
            sign = "-"
        else:
            sign = ""

        numerator = abs(numerator)
        denominator = abs(denominator)

        whole = str(numerator // denominator)
        fraction = str(numerator % denominator)

        if fraction == "0":
            return sign + whole

        fraction_dict = {}
        fraction_list = []
        while fraction != "0":
            if fraction in fraction_dict:
                fraction_list.insert(fraction_dict[fraction], "(")
                fraction_list.append(")")
                break
            else:
                fraction_dict[fraction] = len(fraction_list)
                fraction = str(10 * int(fraction))
                fraction_list.append(fraction[0])

        return sign + whole + "." + "".join(fraction_list)

