class Solution(object):
    def findKthNumber(self, m, n, k):
        """
        :type m: int
        :type n: int
        :type k: int
        :rtype: int
        """

        def count(mid):
            count = 0
            for i in range(1, m+1):
                count += min(mid//i, n)
            return count

        left = 1
        right = m*n
        while left < right:
            mid = (left + right)//2
            if count(mid) < k:
                left = mid + 1
            else:
                right = mid
        return left

