class Solution(object):
    def simplifyPath(self, path):
        """
        :type path: str
        :rtype: str
        """

        # split the path into a list of directories
        dirs = path.split('/')

        # create a stack to hold the directories
        stack = []

        # loop through the list of directories
        for dir in dirs:

            # if the directory is empty or a period, skip it
            if dir == '' or dir == '.':
                continue

            # if the directory is a double period, pop the top directory off the stack
            elif dir == '..':
                if len(stack) > 0:
                    stack.pop()

            # otherwise, add the directory to the stack
            else:
                stack.append(dir)

        # join the directories in the stack with a slash
        return '/' + '/'.join(stack)

