class Solution(object):
    def findWords(self, board, words):
        """
        :type board: List[List[str]]
        :type words: List[str]
        :rtype: List[str]
        """

        # create a set of words
        word_set = set(words)

        # create a set of words found in the board
        found_words = set()

        # loop through the board
        for i in range(len(board)):
            for j in range(len(board[0])):
                # create a string using the current letter and its neighbors
                # check if the string is in the word set
                # if it is, add it to the found words set
                for di in range(-1, 2):
                    for dj in range(-1, 2):
                        if 0 <= i + di < len(board) and 0 <= j + dj < len(board[0]):
                            word = board[i][j]
                            while board[i + di][j + dj] != ' ':
                                word += board[i + di][j + dj]
                                if word in word_set:
                                    found_words.add(word)
                                di += 1
                                dj += 1
                                if 0 <= i + di < len(board) and 0 <= j + dj < len(board[0]):
                                    break

        # return the found words                        
        return list(found_words)

