class Solution(object):
    def findWords(self, board, words):
        """
        :type board: List[List[str]]
        :type words: List[str]
        :rtype: List[str]
        """

        # create a dictionary of words
        word_dict = {}
        for word in words:
            word_dict[word] = 0

        # create a dictionary of board
        board_dict = {}
        for i in range(len(board)):
            for j in range(len(board[0])):
                if board[i][j] not in board_dict:
                    board_dict[board[i][j]] = []
                board_dict[board[i][j]].append([i,j])

        # find the words
        found_words = []
        for word in word_dict:
            found = True
            for letter in word:
                if letter not in board_dict:
                    found = False
                    break
            if found:
                for letter in word:
                    for loc in board_dict[letter]:
                        if self.find_word(board, word, loc[0], loc[1]):
                            found_words.append(word)
                            break
                    if word in found_words:
                        break
        return found_words

    def find_word(self, board, word, i, j):
        if len(word) == 0:
            return True
        if i < 0 or j < 0 or i >= len(board) or j >= len(board[0]) or board[i][j] != word[0]:
            return False
        temp = board[i][j]
        board[i][j] = "#"

        found = self.find_word(board, word[1:], i+1, j) or self.find_word(board, word[1:], i-1, j) or self.find_word(board, word[1:], i, j+1) or self.find_word(board, word[1:], i, j-1)

        board[i][j] = temp
        return found

class Solution(object):
    def findWords(self, board, words):
        """
        :type board: List[List[str]]
        :type words: List[str]
        :rtype: List[str]
        """

        # Initialize the Trie
        root = {}
        for word in words:
            current = root
            for letter in word:
                if letter not in current:
                    current[letter] = {}
                current = current[letter]
            current['#'] = '#'

        # Initialize the answer
        found_words = []

        # Iterate through the board
        for i in range(len(board)):
            for j in range(len(board[0])):
                # Check if the current cell is the starting of any word
                if board[i][j] in root:
                    current = root[board[i][j]]
                    self.dfs(i, j, board, current, found_words)

        return found_words

    def dfs(self, i, j, board, current, found_words):
        # If we have found the entire word, add it to the answer
        if '#' in current:
            found_words.append(board[i][j])

        # If the current cell is not a starting of any word, return
        if board[i][j] not in current:
            return

        # Temporarily mark the current cell as visited
        board[i][j] = ' '

        # Recursively explore all the adjacent cells
        if i > 0 and board[i - 1][j] != ' ':
            self.dfs(i - 1, j, board, current[board[i - 1][j]], found_words)
        if j > 0 and board[i][j - 1] != ' ':
            self.dfs(i, j - 1, board, current[board[i][j - 1]], found_words)
        if i < len(board) - 1 and board[i + 1][j] != ' ':
            self.dfs(i + 1, j, board, current[board[i + 1][j]], found_words)
        if j < len(board[0]) - 1 and board[i][j + 1] != ' ':
            self.dfs(i, j + 1, board, current[board[i][j + 1]], found_words)

        # Backtrack
        board[i][j] = current.keys()[0]

