class Solution(object):
    def isAnagram(self, s, t):
        """
        :type s: str
        :type t: str
        :rtype: bool
        """

        # if the length of the strings are not equal, return false
        if len(s) != len(t):
            return False

        # create a dictionary to store the frequency of each character in string s
        char_freq = {}
        for char in s:
            if char not in char_freq:
                char_freq[char] = 1
            else:
                char_freq[char] += 1

        # iterate through string t
        for char in t:
            if char not in char_freq or char_freq[char] == 0:
                return False
            else:
                char_freq[char] -= 1

        return True

