class Solution(object):
    def findComplement(self, num):
        """
        :type num: int
        :rtype: int
        """

        # Convert the number to binary
        binary = bin(num)[2:]

        # Flip the bits
        flipped = ""
        for i in binary:
            if i == "0":
                flipped += "1"
            else:
                flipped += "0"

        # Convert the flipped binary to decimal
        return int(flipped, 2)

