class Solution(object):
    def fullJustify(self, words, maxWidth):
        """
        :type words: List[str]
        :type maxWidth: int
        :rtype: List[str]
        """

        res = []
        n = len(words)
        start = 0

        while start < n:
            end = start + 1
            length = len(words[start])

            while end < n and length + len(words[end]) + end - start <= maxWidth:
                length += len(words[end])
                end += 1

            if end == n:
                res.append(self.left_justify(words[start:end], maxWidth))
                break

            if end - start == 1:
                res.append(self.left_justify(words[start:end], maxWidth))
            else:
                res.append(self.full_justify(words[start:end], maxWidth, length))

            start = end

        return res

    def left_justify(self, words, maxWidth):
        return " ".join(words) + " " * (maxWidth - len(" ".join(words)))

    def full_justify(self, words, maxWidth, length):
        num_spaces = maxWidth - length
        num_words = len(words) - 1
        avg_spaces = num_spaces // num_words
        extra_spaces = num_spaces % num_words

        res = ""
        for i in range(len(words)):
            res += words[i]
            if i < num_words:
                res += " " * (avg_spaces + 1)
                if extra_spaces > 0:
                    res += " "
                    extra_spaces -= 1
        return res

