class Solution(object):
    def thirdMax(self, nums):
        """
        :type nums: List[int]
        :rtype: int
        """

        # Initialize a set to store the unique elements
        unique_nums = set()

        # Add elements to the set
        for num in nums:
            unique_nums.add(num)

        # If the length of the set is less than or equal to 2, return the maximum element
        if len(unique_nums) <= 2:
            return max(unique_nums)

        # If the length of the set is greater than 2, return the third maximum element
        else:
            # Sort the set in descending order
            sorted_unique_nums = sorted(unique_nums, reverse=True)

            # Return the third maximum element
            return sorted_unique_nums[2]

